	background-color: #fff;
	font-size: 16px;
	z-index: 10;
	right: calc((100% - 1200px) / 2);
	.SvgIcon {
		width: 100%;
		display: flex;
		align-items: inherit;
		justify-content: inherit;
	}
	.SvgIcon-Svg {
		user-select: none;
		width: 1em;
		height: 1em;
		display: inline-block;
		fill: currentColor;
		flex-shrink: 0;
		font-size: inherit;
	}
`;

export default HandleNextArrow;
